import React, { useState, useEffect } from "react";

function App(){

    const [Items, setItems] = useState([]);

    useEffect(

     () =>{
        fetch('http://localhost:8081/').then(response =>{
            if (!response.ok){
                throw new Error('err: ${response.status}')
            }
            response.json().then(data=>{
                console.log(data)
                let tmp = [];
                for (let i of data){
                    tmp.push(i)
                } 
                setItems(tmp)
            })
        })
    }
)
    let cardArray = Items.map( (item) => (
        <div key={item['title']}>
            <img src={item['image']} style={{width: '5rem'}}></img>
            <div>{item['title']}</div>
        </div>
    ))


    return(
        <div>
            <div>{cardArray}</div>
            <button >Send Data</button> 
        </div>
    )
}

export default App
